import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {

    let row;
    
    for (let index = 0; index < props.data.length; index++) {
        row = props.data[index];
    
        return (
            <div  className="expenses">
            <ExpenseItem
                title={row.title}
                amount={row.amount}
                date={row.date}
            >
            </ExpenseItem>
            </div>
      );
        
    }

}

export default Expense;
